Rules.InvariantScript:
ForAll(GroupBy(ForAll(ShowColumns(Filter(HackathonSc1Tasks, TaskStatus = "Inactive", Year('Completed On') = Year(Now())), "cr876_completedon", "createdon"),
With({},
     {WeekNumber:WeekNum(cr876_completedon),
      MTR:DateDiff(createdon, cr876_completedon, "Days")
     }
   )
), "WeekNumber", "MTRs" ),
With({},
     {WeekNumber:WeekNumber,
      MTR:Average(MTRs, MTR)
     }
   )
)
